import React, { Component } from 'react';
import Cities from './cities';
import {Button, Columns, Column} from 'bloomer';
import ReactDOM from 'react-dom';

const Searching = () => {
    const [showResults, setShowResults] = React.useState(false)
    const onClick = () => setShowResults(true)
    return (
      <div>
        <input type="submit" value="Search" onClick={onClick} />
        { showResults ? <Results /> : null }
      </div>
    )
  }

  const Results = () => (
    <div id="results" className="search-results">
      Some Results
    </div>
  )

export class Search extends Component {
    constructor() {
        super();
        this.state = {
          showHideFName: true,
          showHideLName: true
        };
        this.hideComponent = this.hideComponent.bind(this);
      }
    render() {
        return(
            <div>
                <h2>Looking for help? Search for a provider near you</h2>
                <Columns isCentered>
                <Column><Cities/></Column>
                <Column><Button>Go</Button></Column>
                </Columns>{ReactDOM.render(<Searching />, document.querySelector("#container"))}
            </div>
        );
    }
}
